import FactList from "./FactList";

export default class Game {
  clues: FactList;
  timeline: FactList;
  score: number;

  constructor({
    clues = new FactList(),
    timeline = new FactList(), 
    score = 0
  }: { 
    clues?: FactList, 
    timeline?: FactList, 
    score?: number 
  } = {}) {
    this.clues = clues;
    this.timeline = timeline;
    this.score = score;
  }
}
